import React from 'react'
import $ from 'jquery'

export default props => {
	return(

	<div className="first">
		<div className="progress">
			<div className="bar"></div>
			<button className="close">{props.button}</button>
			<div className="loader"></div>
		</div>
	</div>
		)
}
